import React from 'react'
import {connect} from 'react-redux'
const FilteringDetails=(props)=> {
    return (
        <div>
           { props.filteringDetails!==null ?
            <>
            <h2>{props.filteringDetails.categoryName}</h2>
            <h3>Brand Available</h3>
           <h4>{props.filteringDetails.brands}</h4> 
            </>:null}
        </div>
    )
}

const mapStateToProps = state=>{
    console.log(state.category.filteringDetails,"filtering details")
    return{
        id:state.category.id,
        filteringDetails:state.category.filteringDetails
    }
}

export default connect(mapStateToProps)(FilteringDetails)
